// Solution

function calculate(s) {
    let stack = [];
    let sign = '+';
    let num = 0;
    for (let i = 0; i < s.length; i++) {
        if (s[i] === ' ') continue;
        if (Number.isInteger(+s[i])) {
            num = num * 10 + +s[i];
        } else {
            if (sign === '+') {
                stack.push(num);
            } else if (sign === '-') {
                stack.push(-num);
            } else if (sign === '*') {
                stack.push(stack.pop() * num);
            } else if (sign === '/') {
                stack.push(Math.trunc(stack.pop() / num));
            }
            sign = s[i];
            num = 0;
        }
    }
    if (sign === '+') {
        stack.push(num);
    } else if (sign === '-') {
        stack.push(-num);
    } else if (sign === '*') {
        stack.push(stack.pop() * num);
    } else if (sign === '/') {
        stack.push(Math.trunc(stack.pop() / num));
    }
    return stack.reduce((a, b) => a + b);
};

